import styled from 'styled-components';

export const Content = styled.div`
  padding: 20px;
  margin: 50px auto 0;
`;

export const Center = styled.div`
  width: fit-content;
  margin: 0 auto;

  h1 {
    font-size: 1.5rem;
    margin-bottom : 20px;
  }

  h3 {
    color: red;
  }
`;
